CREATE TABLE sys.sysobjects
(
    name sysname NOT NULL,
    id int NOT NULL,
    xtype char(2) NOT NULL,
    uid smallint,
    info smallint,
    status int,
    base_schema_ver int,
    replinfo int,
    parent_obj int NOT NULL,
    crdate datetime NOT NULL,
    ftcatid smallint,
    schema_ver int,
    stats_schema_ver int,
    type char(2),
    userstat smallint,
    sysstat smallint,
    indexdel smallint,
    refdate datetime NOT NULL,
    version int,
    deltrig int,
    instrig int,
    updtrig int,
    seltrig int,
    category int,
    cache smallint
);
